CREATE TABLE CATALOGOS
(	
    ID_CATALOGO NUMBER(10), 
    INDICADOR_CAT NUMBER(10), 
    CLAVE VARCHAR2(200), 
    NOMBRE VARCHAR2(200), 
    DESCRIPCION VARCHAR2(4000), 
    FECHA_ALTA DATE, 
    LLAVE_USR_ALTA NUMBER(10), 
    FECHA_ULT_ACT DATE, 
    LLAVE_USR_ACT NUMBER(10), 
    VALOR NUMBER(10), 
    CC NUMBER(5), 
    CC_TEMP NUMBER(5), 
    PAGINA VARCHAR2(50), 
    CONSECUTIVO NUMBER(5), 
    INDICADOR_MEDIA NUMBER, 
    SEDE NUMBER(3), 
    COLOR_HEX VARCHAR2(7), 
    ESTATUS NUMBER(5), 
    INFO_AD NUMBER(3)
);


